    "2016-04-19T02:28:22.022449",nt"name": "biologic-resource-buffers",nt"isopen":
    false,nt"url": null,nt"notes": "Critical environmental features (CEFs)
    are defined in the City of Austin Land Development Code 25-8-1. CEF buffers are
    defined in the City of Austin Land Development Code 25-8-281. This layer depicts
    buffers or "setbacks" for most CEFs where protection has been designated. Also
    included are areas that have been designated as protected due to an easement, conservation
    area, or mitigated area. This dataset represents CEF buffers identified during the
    development review process since 1995. Prior to 1995, data is either unavailable
    or lost. CEF buffers were digitized from construction plans, environmental assessments,
    and City of Austin staff field observations into a versioned SDE database using
    ArcMap. Actual buffers size for any particular feature may be determined through
    a process of negotiation with land development interests, and may differ from standard
    dimensions stated in the Land Development Code.",nt"license_title": "License
